import React, { useState } from 'react';
import 'sin'

function SignInPage() {
  const [formData, setFormData] = useState({
    permanentAddress: '',
    residentialAddress: '',
    contactHome: '',
    contactPersonal1: '',
    contactPersonal2: '',
    email: '',
    district: '',
    fullName: '',
    nameWithInitials: '',
    nic: '',
    passport: '',
    drivingLicense: '',
    age: '',
    maritalStatus: '',
    policeDomain: '',
    gramasewakaArea: '',
    scannedNic: null,
    scannedBirthCertificate: null,
    recentPhotograph: null
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    const { name, files } = e.target;
    setFormData({ ...formData, [name]: files[0] });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission, e.g., send data to backend
    console.log(formData);
  };

  return (
    <div className="sign-in-page">
      <h2>Welcome to SLPD</h2>
      <h3>Create your profile</h3>
      <form onSubmit={handleSubmit}>
        {/* Permanent Address */}
        <label>Permanent Address:</label>
        <input type="text" name="permanentAddress" value={formData.permanentAddress} onChange={handleChange} />

        {/* Residential Address */}
        <label>Residential Address:</label>
        <input type="text" name="residentialAddress" value={formData.residentialAddress} onChange={handleChange} />

        {/* Contact Information */}
        <label>Contact Information - Home:</label>
        <input type="text" name="contactHome" value={formData.contactHome} onChange={handleChange} />

        <label>Contact Information - Personal 1:</label>
        <input type="text" name="contactPersonal1" value={formData.contactPersonal1} onChange={handleChange} />

        <label>Contact Information - Personal 2:</label>
        <input type="text" name="contactPersonal2" value={formData.contactPersonal2} onChange={handleChange} />

        {/* Email Address */}
        <label>Email Address:</label>
        <input type="email" name="email" value={formData.email} onChange={handleChange} />

        {/* District */}
        <label>Please add a District:</label>
        <select name="district" value={formData.district} onChange={handleChange}>
          <option value="">Select District</option>
          <option value="Ampara">Ampara</option>
          {/* Add other district options */}
        </select>

        {/* Full Name */}
        <label>Full Name:</label>
        <input type="text" name="fullName" value={formData.fullName} onChange={handleChange} />

        {/* Name with Initials */}
        <label>Name with Initials:</label>
        <input type="text" name="nameWithInitials" value={formData.nameWithInitials} onChange={handleChange} />

        {/* NIC */}
        <label>NIC:</label>
        <input type="text" name="nic" value={formData.nic} onChange={handleChange} />

        {/* Passport */}
        <label>Passport:</label>
        <input type="text" name="passport" value={formData.passport} onChange={handleChange} />

        {/* Driving License */}
        <label>Driving License:</label>
        <input type="text" name="drivingLicense" value={formData.drivingLicense} onChange={handleChange} />

        {/* Age */}
        <label>Age:</label>
        <input type="text" name="age" value={formData.age} onChange={handleChange} />

        {/* Marital Status */}
        <label>Please add marital state:</label>
        <select name="maritalStatus" value={formData.maritalStatus} onChange={handleChange}>
          <option value="">Select Marital Status</option>
          <option value="Married">Married</option>
          <option value="Unmarried">Unmarried</option>
        </select>

        {/* Police Domain */}
        <label>Police Domain:</label>
        <input type="text" name="policeDomain" value={formData.policeDomain} onChange={handleChange} />

        {/* Gramasewaka Area */}
        <label>Gramasewaka Area:</label>
        <input type="text" name="gramasewakaArea" value={formData.gramasewakaArea} onChange={handleChange} />

        {/* Scanned NIC copy */}
        <label>Upload your scanned NIC copy:</label>
        <input type="file" name="scannedNic" onChange={handleFileChange} />

        {/* Scanned Birth Certificate */}
        <label>Upload your scanned Birth certificate:</label>
        <input type="file" name="scannedBirthCertificate" onChange={handleFileChange} />

        {/* Recently taken photograph */}
        <label>Upload your recent photograph:</label>
        <input type="file" name="recentPhotograph" onChange={handleFileChange} />

        {/* Submit button */}
        <button type="submit">Create</button>
      </form>
    </div>
  );
}

export default SignInPage;
